  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas web service supports research
  and online mapping activities related to EnviroAtlas (https://www.epa.gov/enviroatlas).
  This EnviroAtlas dataset intelligently reallocates 2010 population from census blocks
  to 30 meter pixels based on land cover and slope. Used for metrics that require
  population to be spatially allocated at a pixel level, primarily in the urban section
  of the atlas. Additional descriptive information about each attribute in this dataset
  can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
